import { Component, OnInit } from '@angular/core';
import { Observable } from 'rxjs';
import { CarService } from '../../services/car.service';
import { Carr, ICar } from '../../models/car';
import { Router } from '@angular/router';
import { FormControl } from '@angular/forms';

@Component({
  selector: 'app-index-cars',
  templateUrl: './index-cars.component.html',
  styleUrls: ['./index-cars.component.css']
})
export class IndexCarsComponent implements OnInit {

  cars!: ICar[];
//adaugare
  exemplu= new Carr('Vw','362',2003,3);

  submitted=false;
  onSubmit(){this.submitted=true;}

  constructor(private carService:CarService, private router: Router) {}

  ngOnInit(): void {
    this.carService.getCars().subscribe(res => {
      this.cars =res;
    console.log(res); }
    )
   }

   showCar(car: ICar)
   {
    this.router.navigate([`/cars/${car.idCar}`]);
   }


   createCar() {

   /* const car: ICar={
    brand: 'VW',
    model: '343',
    productionYear:2022,
    stock: 3
    };*/


    console.log('First Name: ',this.exemplu.brand);

    const car:ICar={

      brand:'',
    model:'',
    productionYear: 0,
    stock:0

    };





  // this will be replaced with form value
  this.carService.createCar(car).subscribe(
    res => this.cars.push(res), 
  );
}



  deleteCar(car: ICar)
  {
    this.carService.deleteCar(car.idCar).subscribe(
      (res: any)=> {
        const carIndex = this.cars.indexOf(car);
        this.cars.splice(carIndex,1);
      }
    )
  }

}
<!-- <p>index-cars works!</p>-->
<style>
.center {
    display: flex;
    justify-content: center;
    align-items: center;
    height: 20px;

  }
</style>





<!----<button (click)="createCar()" type="button" class="btn btn-primary me-2">Create Car</button>-->
<h3> Car Form</h3>
<form (ngSubmit)="createCar()" #carForm="ngForm">



    <div class="form-group">
      <label for="brand">Brand</label>
      <input type="text" class="form-control" id="brand"
             [(ngModel)]="exemplu.brand" name="brand">
    </div>

    <div class="form-group">
      <label for="model">Model</label>
      <input type="text" class="form-control" id="model"
             [(ngModel)]="exemplu.model" name="model">

    </div>


    <div class="form-group">
        <label for="productionYear">Production Year</label>
        <input type="text" class="form-control" id="productionYear"
               [(ngModel)]="exemplu.productionYear" name="productionYear">

      </div>

      <div class="form-group">
        <label for="stock">Stock</label>
        <input type="text" class="form-control" id="stock"
               [(ngModel)]="exemplu.stock" name="stock">

      </div>  

</form>


<button type="submit" class="btn btn-success" [disabled]="!carForm.form.valid">Submit</button>





<div *ngFor="let car of cars">{{car.idCar}} - {{car.brand}} - {{car.model}} 

    <div class="center">

    <button (click)="showCar(car)" type="button" class="btn btn-primary me-2">Show Car</button> 

    <button (click)="deleteCar(car)" type="button" class="btn btn-danger me-2">Delete</button>

    <button (click)="deleteCar(car)" type="button" class="btn btn-danger me-2">Update</button>
</div>


</div>
